Storyline

It tells the story of two lovers, Prem (Salman Khan) and Nisha (Madhuri Dixit). Their older siblings, Rajesh and Pooja get married. After Pooja has her baby, the elders decide to get Prem married with a girl like Pooja. Prem and Nisha slowly fall in love with each other. Prem tells his sister-in-law, Nisha's older sister, Pooja, that he loves Nisha.Pooja binds the two with her blessings and a necklace. Before Pooja can tell anyone the good news, she falls down the stairs, and dies. Everyone feels they lost their life after Pooja dies, because she had a magic touch that even the dog, Tuffy, notices. Rajesh finds life hard without Pooja, and he finds it especially hard to raise their son. The parents decide to get Rajesh married to Nisha so that he won't feel so lonely, and his son will get a mother. Nisha unknowingly accepts because she thinks that she is going to marry Prem. When she finds out she is marrying Rajesh.

